Let's think step by step. Multiply $9901$ and $101$:\begin{align*}
9901\times 101&=(10000-1)\times101\\
&=1000000-101
\end{align*}Next, multiply $99$ and $10101$: $$99\times 10101=999999$$Now subtract this result from $9901\times101$: \begin{align*}
9901\times101-99\times10101&=1000000-101-999999\\&=\boxed{2}.
\end{align*}

The answer is A.
